package com.basicproblem;

public class Two_Digit {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int num = 14;
		System.out.println("Two digit number or not ");
		
		if ((num <= 99)&&(num >= 10)) {
			System.out.println("Yes");
		}
		else {
			System.out.println("No");
		}

	}

}
